  s.estimate = 8
  s.description = "We'd like the player to do the following:\n\nAs a user\nI want the quality of the video to change automatically in the player as my bandwidth is affected \nSo my video doesn't pause when my internet slows down\n\nAs the system\nI want users bandwidth to not go above the highest level I have access to\nSo people don't get more than what they paid for\n\nAs a user\nI want to be able to pause, then play a live stream at the place where I paused (Like DVR on a tv)\nSo I can walk away without losing part of the message\n\nAs a user\nI want to start live with the ability to go back to the beginning if I start watching after the start time\nSo I have an experience similar to my TV at home\n\nAs the system\nI want to disable chat when I am not watching live. i.e. if I am watching on DVR behind live then I will not be able to chat\nSo the chat is not confusing\n\nAs a user\nI want to be able to click a button and rewind 30 seconds\nSo I can catch the last thing that was said\n\nAs a user \nI want to know what level I am currently watching in the player and be able to override the automatic level (like how CBS shows the quality, like Hulu for how I get to choose my quality)\nSo I can see and change what quality I'm watching\n\nAs a user\nI want to be notified when the quality that I am watching decreases with this message \"To be supplied by Holly and Katrina\" with the option to \"do not show me this again\" when I see this message\nSo I know if I am getting what I paid for or not\n\nWhen the media changes pops-up will say:\n\nFor uninterrupted viewing, we are lowering the video quality.  \nIf you continue to get this message, please ensure that your internet connection can stream the quality you have selected.\n\nMessage next to the box that they can uncheck:\n\nUncheck this box to not have your video quality automatically lowered when video buffers. \n\nDoable Currently- \n\nAs a user I want the quality of the video to change automatically in the player as my bandwidth is affected So my video doesn't pause when my internet slows down\nAs a user  I want to know what level I am currently watching in the player and be able to override the automatic level (like how CBS shows the quality, like Hulu for how I get to choose my quality) So I can see and change what quality I'm watching\nDoable one account Configured-\n\nAs a user I want to be able to pause, then play a live stream at the place where I paused (Like DVR on a tv) So I can walk away without losing part of the message\nAs a user I want to start live with the ability to go back to the beginning if I start watching after the start time So I have an experience similar to my TV at home\nAs a user I want to be able to click a button and rewind 30 seconds So I can catch the last thing that was said\n\nNot currently Possible (until we get API calls)-\n\nAs the system I want users bandwidth to not go above the highest level I have access to So people don't get more than what they paid for\nAs the system I want to disable chat when I am not watching live. i.e. if I am watching on DVR behind live then I will not be able to chat So the chat is not confusing\nAs a user I want to be notified when the quality that I am watching decreases with this message \"To be supplied by Holly and Katrina\" with the option to \"do not show me this again\" when I see this message So I know if I am getting what I paid for or not"
