  s.description = "For the XML, there are several iPad and Retina tags that you can implement for feed artwork. In each XML file that contains iPad and Retina tags, be sure to include \n<data xmlns:double=\"http://dashboard.thechurchapp.org/platform/feeds/schemas/double/\"\n\t xmlns:ipad=\"http://dashboard.thechurchapp.org/platform/feeds/schemas/ipad/\"\n\t xmlns:ipaddouble=\"http://dashboard.thechurchapp.org/platform/feeds/schemas/ipad_double/\"> \n\nat the top for your <data> tag. Observe Screenshot below. \n\nFor each image, you will want to have 3 sizes. One for sized for iPhone, Retina(2x) and iPad.  \n\nDouble\nThe \"double:\" namespace that you see in the screenshot below is used specifically for retina devices when they are on a WiFi connection.  Otherwise a device will use the \"iPhone\" sized art provided in the <image> or <icon> tags. The retina size is exactly 2 times the size of the iPhone art.\n\niPad\nThe iPad dimensions are a bit different and you can check those out below. \n\nDouble iPad\nOptionally, you can include a 4th size for ipaddouble (sizes are exactly double the iPad sized art - see specs below) which will be used once a retina iPad gets released by Apple. \n\nExample XML image setup for a banner:\n<banner>\n\t<image>http://assets.thechurchapp.org/_app_media/appid470/images/470_1319240601-IOS_IpadBanner_320x113_Fall.jpg</image>\n\t<double:image>http://assets.thechurchapp.org/_app_media/appid470/images/470_1319240628-IOS_IpadBanner_640x226_Fall.jpg</double:image>\n\t<ipad:image>http://assets.thechurchapp.org/_app_media/appid470/images/470_1319240650-IOS_IpadBanner_768x280_Fall.jpg</ipad:image>\n\t<ipaddouble:image>http://assets.thechurchapp.org/_app_media/appid470/images/470_1319240672-IOS_IpadBanner_1536x560_Fall.jpg</ipaddouble:image>\n</banner>\n\niPad tag spec:\nBanner (768x280) <ipad:image>http://www.harvest.org/iphone/subsplash/images/ipad-banner/messages.png</ipad:image>\nFeatured (384x280) <ipad:image></ipad:image>\nRow Icon (200x112) <ipad:icon>http://www.harvest.org/iphone/subsplash/images/ipad-thumb/series71.jpg</ipad:icon>\nDetail image (768x430) <ipad:posterimage>http://www.harvest.org/iphone/subsplash/images/posterimage/series71.jpg</ipad:posterimage>"
  s.name = "iPad Graphics"
