  s.estimate = 1
  s.description = "Ministry Requests and trips can have the following statuses:\n\nPending - waiting for a decision to be made (entry point into the system.) Dates do not show up on traveler's calendar\n\nDenied - MR has been denied, traveler will not be going on the trip, and a notification has been sent to the requestor. Dates will not show up on the traveler's calendar\n\nAccepted - Trip has been accepted by the traveler and is waiting to be approved by their Travel Manager. Dates will be shown on the traveler's calendar\n\nReferred - Trip has been denied by the traveler and will be sent to the travelers denied box, but email notification has been sent to the requestor suggesting another traveler for them to request. Dates do not show on the traveler's calendar.\n\nTentative - Travel Manager is in the process of confirming dates and trip details. Tentative travel will show on the traveler's calendar so the travel partners will not plan on the same dates. \n\nApproved - Trip has been approved by the traveler's approver. Trip will show on the traveler's calendar as a booked trip and the trip will be added to the traveler's itinerary."
  s.name = "Trips Status"
  s.requestor_id = nil
  s.owner_id = nil
  s.pivotal_created_at = "2012-05-23 20:44:47 UTC"
